import React from 'react';
import NavbarTop from './NavbarTop';
import lessonincomplete from '../img/lessonincomplete.svg';
import '../App.css';

function Dashboard() {
	return (
		<header>
			<NavbarTop />
			<div style={styles.container}>
				<img src={lessonincomplete} style={styles.lessonsElement} />
				<p style={(styles.defaultFontFamily, { fontWeight: '700' })}>
					Lesson 1
				</p>
			</div>
		</header>
	);
}

const styles = {
	defaultFontFamily: {
		fontFamily: 'din-round, sans-serif'
	},
	lessonsElement: {
		height: '10vmin'
	},
	container: {
		minHeight: '100vh',
		display: 'flex',
		flexDirection: 'column',
		alignItems: 'center',
		justifyContent: 'center',
		fontSize: 'calc(10px + 2vmin)'
	}
};
export default Dashboard;
